('1) What distinguishes a traditional software development process (e.g., the waterfall, incremental, or spiral approach) from an agile software development process (e.g., scrum, crystal, Kanban, XP, etc.)? Give an overview of both kinds of process (traditional and agile) in terms of how they address and move between requirements collection, design, coding/unit testing, integration and testing, product release, and maintenance, as well as the differences in workflow, division of labor, and strengths/weaknesses of both traditional and agile. 2) What are ways that software projects grow in size and complexity? Describe one way to simplify a complex project. 3) In your own words, what are the ethical tenets or ideas for software engineers? To whom are software engineers responsible? When there are conflicts, which ethical responsibilities are most important, and why? 4) We have made a few choices in class as a group about our tools and processes (e.g., using AI, and which container building tool to use). Imagine you are the tech lead of a team and you need to decide on a technology to recommend for your company to use (perhaps a cloud computing service to host your website and database -- or whatever other example you\'d like to choose). How would you collect information and evaluate it to make the best informed choice you can? Try to describe your process such that someone else who followed it could come to the same conclusion - give concrete steps and reasons.', '2025-11-25 12:20:20', '0000-00-00', 5, 5),
